import styled from "styled-components";

export const Wrapper = styled.div`
    background-color: var
    width: 100%;
`;

export const Content = styled.div`
    width: 100%;

li {
   list-style: none;


}
.image_carousel_container{
    height: 250px;
    position: relative;
}

img {
    position: absolute;
    width: 100%;
}
`;
